script: |
  super -f text -I q8256.spq | sort > q8256.out

inputs:
  - name: q8256.spq
    data: |
      SELECT DISTINCT + ( - 23 ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet) cor2;
  - name: tab0
  - name: tab2

outputs:
  - name: q8256.out
    data: |
      -23
